import React from 'react'

export const Card = () => {

    const Api = async() => {

        const url = 'https://api.gael.cl/general/public/sismos?ApiKey=xxxxxxxxxxxxxxxx';
        const resp = await fetch( url );
        const { data } = await resp.json();

        const Apics = data.map( datos => {
            return{
                Fecha: datos.Fecha
            }
        })

    }


    return (
        <>
           <h1>{ datos.Fecha }</h1> 
        </>
    )
}
